import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {

  class Chat extends React.Component {
    constructor(props){
      super(props);
    }
    render(){
      return (
        <div id="chat">
          <ul id="messages">
          </ul>
          <div id="typehold">
            <input type="text" placeholder="enter a message..."></input>
          </div>
        </div>
      );
    }
  }
  return <Chat />
}

export default App;
